import React, { Fragment } from 'react';
import Pic from '../asset/image/main_img.png';
const HomeFirst = () => {
  return (
    <Fragment>
      <img src={Pic} alt='pic' style={{ width: '1080px' }} />
    </Fragment>
  );
};

export default HomeFirst;
